    "media": MediaResults,
    "youtube": MediaResults,
    "vimeo": MediaResults,
    "sketchfab": MediaResults,
    "documents": DocumentsResults,
    "ekultur": DocumentsResults
}

const SearchResults = ({query = {}, ...props}) => {

